import ryan from "./image/ryan.png"



function App() {
  return (
    <div className="App">
        <div>
          <img src="{ryan}" ></img>
          <h2>라이언</h2>
          <p>덩치는 크지만 마음은 여린 수사자</p>
        </div>
        <div>
          <img></img>
          <h2>춘식</h2>
          <p>안냥. 난 라이언과 동거중인 춘식이다냥!</p>
        </div>


    </div>
  );
}

export default App;
